INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760112650360', '112G Poulet Roules Fromages X16 Etoile Vercors', 'jambon cuit 50% (viande de oorc 34%, eau, sel, protéines végétales (soja), amidon modifié de mais, stabilisants: E451, E450, E452, épaississants: E40ia, E407, fibre de blé (gluten), exhausteur de goût: E621, protéines animales, dextrose, antioxydants: E316, E301, régulateurs d\'acidite: E261, E326, maltodextrine, arômes, conservateur: E250 ). Fromage au lait pasteurisé de vache 50% (lait, ferments (lait), olives vertes, mélange persil et ail, ail surchoix, sel, poivre noir moulu, paprika, conservateur : sorbate de potassium, présure). Présence possible de moutarde, poisson, sulfites. Ingrediënten: gek00ÈÇte ham 50% (vekensvlees 34% , water, zout, plantaardig eiwitten (sojabonen), gemodificeerd maiszetmeel, stabilisateren: E451, E45Ç E452, verdikkingsmiddelen: E407a, E407, tarwemeel (gluten), smaakversterker: E621, dierlijke eiwitten, dextrose, antioxidanten: E316, E301, zuurtegraadregelaar: E261, E326, maltodeftine, aroma\'s , conserveermiddel: E250,). Gepasteuriseerde kaas 50% (koemelk, fermenten (melk), groene olijven, peterselie/knoflook mix, knoflook, zout, zwarte peper, paprika, conserveermiddel: kaliumsorbaat, stremsel). Kan sporen bevatten van mosters, vis, sulfieten. Conseils de préparation: ouvrez la barquette de Roulés et laissez-la à température ambiante 15 min. avant dégustation. A . consommer dans les 24 heures après ouverture. Conditionné sous atmosphère protectrice. Gebruiksadvies: open de verpakking en laat het circa 15 minuten op kamertemperatuur komen. Consumeer binnen 24 uur na pening. Verpakt onder beschermende atmosfeer. conserverentre +20 +6\'C. Te bewaren tussen +2 en +60C.', 'https://static.openfoodfacts.org/images/products/376/011/265/0360/front_fr.12.400.jpg', '11', '7.3', '3.6', '0.8', '0', '14', '1.8', '0.708661417322835', '', '0');

