INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760114910264', 'Truite fumée Bio', '07%2/2018 frv*ierci d\'avoir choisi un de nos produits. Nous vous en souhaitons une bonne dégustation. Nous sommes une entreprise artisanale basée à Saint Malo et à travers la gamme BREIZH SAVEURS, nous proposons des produits authentiques, de grande qualité et élaborés en Bretagne. Pour vous proposer un produit d\'excellence, tous nos poissons sont sélectionnés avec le plus grand soin auprès de producteurs respectueux des bonnes pratiques d\'élevage et de pêche. Vient ensuite le travail des artisans fumeurs qui vont assurer la preparation et le fumage au cour4de plusieurs longues étapes. A chaque, moment nous accordons une attention particulière à l\'élaboration de nos recettes : Salage précis, respect des temps de repos et de fumage, choix des bois pour la fumaison Savoir prendre son temps, rigueur et savoir faire sont les secrets d\'un poisson fumé de grande qualité, De plus, en fabriquant localement, nous sommes fiers de contribuer au développement économique local.', 'https://static.openfoodfacts.org/images/products/376/011/491/0264/front_fr.4.400.jpg', '8.65', '2.62', '0', '0', '', '23.4', '3', '1.18110236220472', '', '0');

