VALUES ('3760116620079', 'Mini muffins fourrés framboise', 'Fourrage à la framboise* 21 % (sucre de canne*, sirop de riz*, purée concentrée de framboises* 2% (équivalent fruit 6.3%), huile de tournesol*, purée concentrée de pommes*, jus concentré de citron*, arôme naturel de framboise* gélifiant pectines, jus concentré de carotte pourpre*, correcteurs d\'acidité: citrates de calcium et citrates de sodium), ceufs*, huile de tournesol*, farine de blé* (farine de blé, farine de blé malté*), sucre de canne blond*, fécule de manioc*, poudre d\'amande*, sirop de glucose* (maïs), poudres à lever carbonates de sodium et phosphates de calcium, arôme naturel*, émulsifiant lécithines (tournesol), sel marin, épaississant : gomme guar Ingrédients issus de l\'agriculture biologique. Allergènes risque de traces d\'autres fruits à coque et de lait.', 'https://static.openfoodfacts.org/images/products/376/011/662/0079/front_fr.4.400.jpg', '24', '2.8', '52', '32', '', '5.2', '0.56', '0.220472440944882', '', '0');

